import React, { useEffect } from "react";
import {
	TextField,
	GridList,
	GridListTile,
	GridListTileBar,
	ListSubheader,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import { loadFeed } from "./actionCreators";
import { useDispatch, useSelector, shallowEqual } from "react-redux";

const useStyles = makeStyles(() => ({
	root: {
		display: "flex",
		flexWrap: "wrap",
		justifyContent: "space-around",
		overflow: "hidden",
		backgroundColor: "black",
	},
	gridList: {
		width: "100%",
		height: 450,
		backgroundColor: "gray",
	},
}));

const HomePage = () => {
	const classes = useStyles();
	const dispatch = useDispatch();

	const feed = useSelector((state) => state.feed, shallowEqual);
	const page = useSelector((state) => state.page, shallowEqual);
	console.log(feed);
	useEffect(() => {
		dispatch(loadFeed(page));
	}, []);

	return (
		<>
			<h1>Home Page</h1>
			<form>
				<TextField placeholder="Search recipes" variant="outlined" />
			</form>
			<div className={classes.root}>
				<GridList className={classes.gridList}>
					<GridListTile cols={2}>
						<ListSubheader component="div">Recipes!</ListSubheader>
					</GridListTile>
					{feed.map((recipe) => (
						<GridListTile key={recipe.id}>
							<img src={recipe.image} />
