								// actionIcon={
								// 	<IconButton
								// 		aria-label={`info about ${recipe.name}`}
								// 		className={classes.icon}
								// 	>
								// 		<InfoIcon />
								// 	</IconButton>
								// }
							/>
						</GridListTile>
					))}
				</GridList>
			</div>
		</>
	);
};

export default HomePage;
